import pytest
from answers import *

inputDNA = ""
RNA = ""
complementaryDNA = ""
reverseComplementaryDNA = ""
percentages = {'A': 25.18, 'C': 24.82, 'T': 25.7, 'G': 24.3}
pur_pyr_count = {'Number of purine bases': 2474, 'Number of pyrimidine bases': 2526}
motifs_result = 5

@pytest.mark.m_1  # 1
def test_DNAtoRNA():
    assert DNAtoRNA(inputDNA) == RNA, "There is a problem with my DNAtoRNA function"

@pytest.mark.m_2  # 1
def test_getNucleotidePercentages():
    assert (
        getNucleotidePercentages(inputDNA) == percentages
    ), "There is a problem with my getNucleotidePercentages function"

@pytest.mark.m_3  # 2
def test_count_Pur_Pyr():
    assert (
        count_Pur_Pyr(inputDNA) == pur_pyr_count
    ), "There is a problem with my count_Pur_Pyr function"

@pytest.mark.m_4  # 2
def test_getComplementaryDNA():
    assert complementaryDNA == getComplementaryDNA(
        inputDNA
    ), "There is a problem with my getComplementaryDNA function"

@pytest.mark.m_5  # 1
def test_reverseComplementaryDNA():
    assert reverseComplementaryDNA == getReverseComplementaryDNA(
        inputDNA
    ), "There is a problem with my getReverseComplementaryDNA function"

@pytest.mark.m_6  # 3

def test_find_motifs():
    assert (
        find_motifs(inputDNA) == motifs_result
    ), "There is a problem with my find_motifs function"

